import React from 'react';


const ListenWatchTab = () => {

    return (
        <div className="listen">
            <div className="listen-tab">
                <a href="/watch"><i class="fa fa-tv"></i></a>
                <a href="/Listen">Radio</a>
            </div>
        </div>
    );
}


export default ListenWatchTab;
